import React,{ useRef ,useEffect,useState}  from 'react';
import { motion, useTransform, useScroll } from "framer-motion";
import Navbar from './Navbar';
import '../styles/Home.css'; // Import the CSS file
import Wave from '../assets/wave.png'
import { useNavigate } from 'react-router-dom';
import Slider from './Slider.js'
import Google from '../assets/google.png';
import Microsoft from '../assets/microsoft.png';
import SplitSection from './SplitSection.js';
import ProjectCard from './ProjectCard.js';

const App = () => {
  const navigate = useNavigate();


  const projects = [
    {
        title: "Business Startup",
        description: "Design & Development",
        imgUrl: Wave,
    },
    {
        title: "Business Startup",
        description: "Design & Development",
        imgUrl: Google,
    },
    {
        title: "Business Startup",
        description: "Design & Development",
        imgUrl: Microsoft,
    },
    {
        title: "Business Startup",
        description: "Design & Development",
        imgUrl: projImg3,
    },
];



  return (


    <div>

      <Navbar />

      {/* Section 1 */}
      <div className="section section1" style={{ backgroundImage: `url(${Wave})` }}>
        <div className="left-part">
            <h2>I'm Aspiring Data Analyst With Strong Analytical Skills, Committed to Transforming Data into Actionable Insights.</h2>

            </div>

            {/* Right Part */}
            <div className="right-part">

            </div>
      </div>

      {/* Section 2 */}

      <div className="section section2">
        <h1>
          I Excel in Crafting Powerful Analytics Projects, Business Intelligence Dashboards, and Insightful Data  Reports.
        </h1>



          <button onClick={
            ()=>navigate('/projects')
          }>
            Explore Projects
          </button>

      </div>

      <div>

      </div>
       <div>
         {
          projects.map((project, index) => {
            return (
                <ProjectCard
                    key={index}
                    {...project}
                />
            )
        })
         }
       </div>
      {/* Section 3 */}

      <div className="section section3">
        <Slider/>
      </div>


      {/* Section 4 */}
      <div className="section section4">
          <SplitSection/>
      </div>

      {/* Section 5 */}
      <div className="section section5">
        {/* Content for Section 5 */}
      </div>
    </div>


  );
};



export default App;
